import base64


from PIL import Image
from tkinter import *
from PIL import ImageTk, Image
import os

def easter():

    img_str=""
    decodeit = open('egg.jpeg', 'wb')
    decodeit.write(base64.b64decode((img_str)))
    decodeit.close()
    


    root = Tk()
    root.title('Authors')
    
    img = ImageTk.PhotoImage(Image.open('egg.jpeg'))  # PIL solution
    os.remove('egg.jpeg')
    w = img.width()
    h = img.height()

    
    
    canv = Canvas(root, width=w, height=h, bg='white')
    canv.grid(row=2, column=3)
    
    
    canv.create_image(0, 0, anchor=NW, image=img)
    
    mainloop()